import React from 'react'
import { Play } from '../Alies'

const TFP1 : React.FC<{value:Play}> = ({value}) => {
    if (value.play_type==="TFP1"){
        return (
            <div>
              {value.kicker} {value.yards_gained} fieldGaol is {value.kick_isgood}.
            </div>
          )
    }
  return null
}

export default TFP1
